import React, { Component } from 'react';

class YouTubeData extends Component {
  constructor(props) {
    super(props);

    this.state = { data: [] }
  }


  FetchData = async() => {
    alert("you got here");
  }

  render() {

    if (!this.props.user) {
      var Content = "";
    } else {
      var Content = <button onClick={this.FetchData}>Fetch Data</button>;
    }

    return(
      <div className="Data">
        {Content}
      </div>
    );
  }
}

export default YouTubeData;
